import React, {useState} from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';

const App = () => {
    const [posts, setPosts] = useState([]);
    fetch('https://strangers-things.herokuapp.com/api/COHORT-NAME/posts')
        .then(response => response.json())
        .then(result => {
            setPosts(result.data.posts);
            console.log(posts);
        })
        .catch(console.error);
  return <div>
      {posts.map((element, index) => {
          return(
              <div className = "post" key = {index}> 
                  <h1> {element.title}</h1>
                  <p> <b>Price: </b> {element.price}</p>
                  <p><b>Location: </b> {element.location}</p>
                  <p><b>Will Deliver:</b>{element.willDeliver}</p>
                  <p> <b>Description: </b>{element.description}</p>
              </div>
          )
      })}
  </div>
}
ReactDOM.render(
  <App />,
  document.getElementById('app'),
);
